import React from 'react';

export default function Pages({ totalPages }) {
  const pageNumbers = Array.from({ length: totalPages }, (_, index) => index + 1);

  return (
    <div>
      {pageNumbers.map((pageNumber) => (
        <span key={pageNumber}>{pageNumber}</span>
      ))}
    </div>
  );
}
